/*Table structure for table `asset_alokasi` */

DROP TABLE IF EXISTS `asset_alokasi`;

CREATE TABLE `asset_alokasi` (
  `NomorAsal` char(10) COLLATE utf8_unicode_ci NOT NULL,
  `SerialNumber` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `KodeAlokasi` char(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Tanggal` datetime DEFAULT NULL,
  `NomorService` char(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`NomorAsal`),
  KEY `FK_asset_alokasi_status` (`KodeAlokasi`),
  KEY `FK_asset_alokasi_sn` (`SerialNumber`),
  KEY `FK_asset_alokasi_no_service` (`NomorService`),
  CONSTRAINT `FK_asset_alokasi_no_service` FOREIGN KEY (`NomorService`) REFERENCES `service` (`NomorService`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_asset_alokasi_sn` FOREIGN KEY (`SerialNumber`) REFERENCES `asset` (`SerialNumber`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_asset_alokasi_status` FOREIGN KEY (`KodeAlokasi`) REFERENCES `status_asset` (`KodeAlokasi`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

